import { Component } from '@angular/core';
import { User } from 'src/app/models/User';
import { GetUserInfoService } from 'src/app/services/get-user-info.service';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.scss']
})
export class HomeComponent {
  //create user to store data
  users: User[] = [];

  constructor(public userService: GetUserInfoService) {
    this.userService.GetUser().subscribe((data) => {
      console.log(data);
      this.user = Array.isArray(data) ? data : [data]; // wrap single user in an array
    });
  }
}
